import Widgets from "../Widgets";



class Login extends Component{



  render() {
    return (
        <div className="login">
          <div className="login__img">
            <img
                src="/logo.png"
                alt=""
            />
          </div>
          <div className="log__input">
            <input placeholder="ID" type="text"/>
            <input placeholder="Password" type="text"/>
          </div>
          <Button type="submit"
                 >
            Sign in
          </Button>

          {this.props.login ? (
              <>
                <Button type="submit" >
                  Sign
                </Button>
              </>
          ) : (
              <>
                <Button type="submit" >
                  Sign Up
                </Button>
              </>
          )}
        </div>
    )
  }


}


